# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - Django.db.models.Model~Subclass
    - rest_framework_simplejwt
    - Member[authentication].Member[AbstractBaseUser]
  - - Django.db.models.Model~Subclass
    - rest_framework_simplejwt
    - Member[serializers].Member[AbstractBaseUser]
  - - Django.db.models.Model~Subclass
    - rest_framework_simplejwt
    - Member[token_blacklist].Member[admin].Member[AbstractBaseUser]
  - - Django.db.models.Model~Subclass
    - rest_framework_simplejwt
    - Member[tokens].Member[AbstractBaseUser]
